pragma solidity ^0.5.10;
import "@openzeppelin/contracts/token/ERC20/ERC20Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Detailed.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Burnable.sol";

contract SaintGiong is ERC20Detailed,ERC20Burnable,ERC20Pausable {
    constructor(string memory name,string memory symbol, uint8 decimals)
    ERC20Detailed(name,symbol,decimals) ERC20Burnable() ERC20Pausable() public {
        _mint(_msgSender(),100000000 * 10 ** 18);
    }

    function fundICO(address to) public{
        transfer(to, 70000000 *10**18);
    }
}
